function init(event) {
    event.item.setCustomName("Factions list");
    event.item.setTexture("minecraft:book");
    event.item.setDurabilityShow(false);
}

function interact(event) {
    var factions = event.API.getFactions().list();
    for (var i = 0; i < factions.size(); i++) {
        var faction = factions[i];

        debug(event, "[" + faction.getId() + "] " + faction.getName());
    }
}

